import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import styled, { keyframes } from "styled-components";

// Animation keyframes
const float = keyframes`
  0% { transform: translateY(0px); }
  50% { transform: translateY(-10px); }
  100% { transform: translateY(0px); }
`;

// Styled components
const FeatureCard = styled(motion.div)`
  background: white;
  border-radius: 16px;
  padding: 2.5rem;
  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.05);
  text-align: center;
  position: relative;
  overflow: hidden;
  z-index: 1;

  &::before {
    content: "";
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 5px;
    background: linear-gradient(90deg, #3498db, #2ecc71);
  }
`;

const Home = () => {
  return (
    <div style={styles.container}>
      {/* Hero Section */}
      <motion.section
        style={styles.hero}
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.8 }}
      >
        <div style={styles.heroContent}>
          <motion.h1
            style={styles.title}
            initial={{ y: 50 }}
            animate={{ y: 0 }}
            transition={{ delay: 0.2 }}
          >
            <span style={styles.titleIcon}>🎓</span> Student Course Management
          </motion.h1>

          <motion.p
            style={styles.subtitle}
            initial={{ opacity: 0 }}
            animate={{ opacity: 0.9 }}
            transition={{ delay: 0.4 }}
          >
            Transform educational administration with our intuitive platform
          </motion.p>

          <motion.div
            style={styles.buttonGroup}
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.6 }}
          >
            <Link to="/students" style={styles.link}>
              <motion.button
                style={styles.primaryButton}
                whileHover={{ y: -3 }}
                whileTap={{ scale: 0.98 }}
              >
                <span style={styles.buttonIcon}>👥</span> Student Portal
              </motion.button>
            </Link>
            <Link to="/courses" style={styles.link}>
              <motion.button
                style={styles.secondaryButton}
                whileHover={{ y: -3 }}
                whileTap={{ scale: 0.98 }}
              >
                <span style={styles.buttonIcon}>📚</span> Course Dashboard
              </motion.button>
            </Link>
          </motion.div>
        </div>

        <motion.div
          style={styles.heroPattern}
          animate={{
            x: [0, 10, 0],
            y: [0, -10, 0],
          }}
          transition={{
            duration: 15,
            repeat: Infinity,
            ease: "linear",
          }}
        />
      </motion.section>

      {/* Features Section */}
      <section style={styles.features}>
        <motion.h2
          style={styles.featuresTitle}
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ delay: 0.2 }}
        >
          Powerful Features
        </motion.h2>

        <div style={styles.featuresGrid}>
          <FeatureCard
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ delay: 0.3 }}
            whileHover={{ y: -10 }}
          >
            <div
              style={{
                ...styles.featureIcon,
                animation: `${float} 4s ease-in-out infinite`,
              }}
            >
              👥
            </div>
            <h3 style={styles.featureTitle}>Comprehensive Student Profiles</h3>
            <p style={styles.featureText}>
              Detailed academic records, attendance tracking, and performance
              analytics in one centralized hub.
            </p>
          </FeatureCard>

          <FeatureCard
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ delay: 0.4 }}
            whileHover={{ y: -10 }}
          >
            <div
              style={{
                ...styles.featureIcon,
                animation: `${float} 4s ease-in-out infinite 0.5s`,
              }}
            >
              📝
            </div>
            <h3 style={styles.featureTitle}>Course Orchestration</h3>
            <p style={styles.featureText}>
              Dynamic curriculum management with real-time scheduling and
              resource allocation.
            </p>
          </FeatureCard>

          <FeatureCard
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ delay: 0.5 }}
            whileHover={{ y: -10 }}
          >
            <div
              style={{
                ...styles.featureIcon,
                animation: `${float} 4s ease-in-out infinite 1s`,
              }}
            >
              📊
            </div>
            <h3 style={styles.featureTitle}>Advanced Analytics</h3>
            <p style={styles.featureText}>
              Predictive insights and customizable reporting for data-driven
              decision making.
            </p>
          </FeatureCard>
        </div>
      </section>
    </div>
  );
};

const styles = {
  container: {
    minHeight: "100vh",
    fontFamily: "'Inter', -apple-system, BlinkMacSystemFont, sans-serif",
    color: "#2d3436",
    overflowX: "hidden",
  },
  hero: {
    background: "linear-gradient(135deg, #3498db 0%, #2c3e50 100%)",
    padding: "6rem 2rem 8rem",
    textAlign: "center",
    color: "white",
    position: "relative",
    overflow: "hidden",
  },
  heroContent: {
    maxWidth: "900px",
    margin: "0 auto",
    position: "relative",
    zIndex: 2,
  },
  heroPattern: {
    position: "absolute",
    top: 0,
    left: 0,
    width: "100%",
    height: "100%",
    backgroundImage:
      "radial-gradient(rgba(255,255,255,0.1) 2px, transparent 2px)",
    backgroundSize: "40px 40px",
    zIndex: 1,
  },
  title: {
    fontSize: "3rem",
    fontWeight: "800",
    marginBottom: "1.5rem",
    lineHeight: "1.2",
    textShadow: "0 2px 10px rgba(0,0,0,0.2)",
  },
  titleIcon: {
    marginRight: "15px",
    display: "inline-block",
    animation: "float 6s ease-in-out infinite",
  },
  subtitle: {
    fontSize: "1.4rem",
    fontWeight: "300",
    marginBottom: "3rem",
    opacity: "0.9",
    maxWidth: "700px",
    marginLeft: "auto",
    marginRight: "auto",
    lineHeight: "1.6",
  },
  buttonGroup: {
    display: "flex",
    justifyContent: "center",
    gap: "1.5rem",
    flexWrap: "wrap",
  },
  link: {
    textDecoration: "none",
  },
  primaryButton: {
    background: "linear-gradient(135deg, #2ecc71 0%, #27ae60 100%)",
    color: "white",
    border: "none",
    padding: "1rem 2.5rem",
    fontSize: "1.1rem",
    borderRadius: "50px",
    cursor: "pointer",
    display: "flex",
    alignItems: "center",
    gap: "0.75rem",
    boxShadow: "0 10px 20px rgba(46, 204, 113, 0.3)",
    transition: "all 0.3s cubic-bezier(0.25, 0.8, 0.25, 1)",
    fontWeight: "500",
  },
  secondaryButton: {
    background: "rgba(255, 255, 255, 0.1)",
    color: "white",
    border: "2px solid rgba(255, 255, 255, 0.3)",
    padding: "1rem 2.5rem",
    fontSize: "1.1rem",
    borderRadius: "50px",
    cursor: "pointer",
    display: "flex",
    alignItems: "center",
    gap: "0.75rem",
    backdropFilter: "blur(5px)",
    transition: "all 0.3s cubic-bezier(0.25, 0.8, 0.25, 1)",
    fontWeight: "500",
  },
  buttonIcon: {
    fontSize: "1.3rem",
  },
  features: {
    maxWidth: "1300px",
    margin: "-4rem auto 0",
    padding: "0 2rem 6rem",
    position: "relative",
  },
  featuresTitle: {
    textAlign: "center",
    fontSize: "2.5rem",
    fontWeight: "700",
    marginBottom: "4rem",
    color: "#2c3e50",
    position: "relative",
    display: "inline-block",
    left: "50%",
    transform: "translateX(-50%)",

    "&::after": {
      content: '""',
      position: "absolute",
      bottom: "-15px",
      left: "50%",
      transform: "translateX(-50%)",
      width: "80px",
      height: "4px",
      background: "linear-gradient(90deg, #3498db, #2ecc71)",
      borderRadius: "2px",
    },
  },
  featuresGrid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fit, minmax(320px, 1fr))",
    gap: "2.5rem",
  },
  featureIcon: {
    fontSize: "3.5rem",
    marginBottom: "2rem",
  },
  featureTitle: {
    fontSize: "1.5rem",
    fontWeight: "600",
    marginBottom: "1.25rem",
    color: "#2c3e50",
  },
  featureText: {
    color: "#636e72",
    lineHeight: "1.7",
    fontSize: "1.05rem",
  },
};

export default Home;
